from os import makedirs, mkdir, listdir
from os.path import join, isfile, exists

import pickle
import csv
import re

from collections import Counter
from tqdm import tqdm
import copy

import spacy
nlp = spacy.load("en_core_web_sm")


class Example(object):
    def __init__(self, id, text_a, text_b, label):
        self.id = id
        self.text_a = text_a
        self.text_b = text_b
        self.label = label

        # Merge highlights from 3 annotators
        self.highlights = {"text_a": [], "text_b": []}
        self.annotators = {"annotator1": {"text_a": [], "text_b": []},
                           "annotator2": {"text_a": [], "text_b": []},
                           "annotator3": {"text_a": [], "text_b": []},}

        self.processed_length = 0
        self.split = 0        # 1: train / 3: dev / 2: test

    def merge_highlights(self, agreement_level=1):
        text_a_highlights, text_b_highlights = [], []
        regex = re.compile('[.,@_!#$%^&*()<>?/\|}{~:]')

        # Extract all annotations for text_a and text_b from 3 annotators
        for _, values in self.annotators.items():
            text_a_highlights.extend(values["text_a"])
            text_b_highlights.extend(values["text_b"])

        # Filter pairs which appear less than 2 times
        text_a_highlights = [pair for pair, freq in Counter(text_a_highlights).items() if freq >= agreement_level]
        text_b_highlights = [pair for pair, freq in Counter(text_b_highlights).items() if freq >= agreement_level]
        counter = 0

        # Prepare a list of tokens with new continuous indices for text_a and text_b
        tokens_text_a = self.text_a.strip().split(" ")
        for i, token in enumerate(tokens_text_a):
            doc = nlp(token)
            for j, sub_token in enumerate(doc):
                if isinstance(tokens_text_a[i], str):
                    tokens_text_a[i] = [(counter, sub_token.text)]
                else:
                    tokens_text_a[i].extend([(counter, sub_token.text)])

                counter += 1

        tokens_text_b = self.text_b.strip().split(" ")
        for i, token in enumerate(tokens_text_b):
            doc = nlp(token)
            for j, sub_token in enumerate(doc):
                if isinstance(tokens_text_b[i], str):
                    tokens_text_b[i] = [(counter, sub_token.text)]
                else:
                    tokens_text_b[i].extend([(counter, sub_token.text)])

                counter += 1

        # Update new indices for highlight tokens in text_a and text_b
        for i, (idx, token) in enumerate(text_a_highlights):
            for new_idx, sub_token in tokens_text_a[idx]:
                if sub_token == token or len(sub_token) > 1 or (len(sub_token) == 1 and regex.search(sub_token) == None):
                    text_a_highlights[i] = (new_idx, token)

        for i, (idx, token) in enumerate(text_b_highlights):
            for new_idx, sub_token in tokens_text_b[idx]:
                if sub_token == token or len(sub_token) > 1 or (len(sub_token) == 1 and regex.search(sub_token) == None):
                    text_b_highlights[i] = (new_idx, sub_token)

        self.highlights["text_a"] = text_a_highlights
        self.highlights["text_b"] = text_b_highlights
        self.processed_length = counter


def verify_and_extract_pairs(sent_marked, highlights):
    highlight_indices = list(map(int, highlights.split(",")))
    highlight_tokens = [(idx, token[1:-1]) for idx, token in enumerate(sent_marked.strip().split(" ")) if len(token) > 2 and token[0] == token[-1] == "*"]

    for idx, _ in highlight_tokens:
        assert idx in highlight_indices

    return highlight_tokens


def process_esnli():
    data_path = "../datasets/esnli/"
    examples = []
    annotators = {1: {"text_a": [], "text_b": [], "stats": []},
                  2: {"text_a": [], "text_b": [], "stats": []},
                  3: {"text_a": [], "text_b": [], "stats": []}}

    all_file_names = listdir(data_path)
    for file_name in all_file_names:
        if not isfile(data_path + file_name):
            continue

        input_file = open(data_path + file_name, "r")

        if file_name == "esnli_dev.csv":
            # creating a csv reader object
            csvReader = csv.reader(input_file)
            fields = next(csvReader)

            # extracting each data row one by one
            for idx, row in tqdm(enumerate(csvReader)):
                example = Example(id=idx, text_a=row[fields.index("Sentence1")], text_b=row[fields.index("Sentence2")],
                                  label=row[fields.index("gold_label")])
                example.split = 3  # For Dev set only

                # We have 3 annotators
                for j in range(1, 4, 1):
                    sent1_highlights = row[fields.index("Sentence1_Highlighted_{}".format(j))]
                    sent2_highlights = row[fields.index("Sentence2_Highlighted_{}".format(j))]

                    if sent1_highlights != "{}":
                        sent1_marked = row[fields.index("Sentence1_marked_{}".format(j))]
                        sent1_pairs = verify_and_extract_pairs(sent1_marked, sent1_highlights)  # list of tuples
                        example.annotators["annotator{}".format(j)]["text_a"] = sent1_pairs
                        annotators[j]["text_a"].append(1)
                    else:
                        annotators[j]["text_a"].append(0)

                    if sent2_highlights != "{}":
                        sent2_marked = row[fields.index("Sentence2_marked_{}".format(j))]
                        sent2_pairs = verify_and_extract_pairs(sent2_marked, sent2_highlights)  # list of tuples
                        example.annotators["annotator{}".format(j)]["text_b"] = sent2_pairs
                        annotators[j]["text_b"].append(1)
                    else:
                        annotators[j]["text_b"].append(0)

                example.merge_highlights(agreement_level=3)
                examples.append(example)

        input_file.close()

    # ------------------------------------------------------------------------------------------------------------
    # FOR STATISTICS HERE
    # ------------------------------------------------------------------------------------------------------------
    for annotator_id, values in annotators.items():
        premise_only, hypothesis_only, both, none = 0, 0, 0, 0
        for text_a, text_b in zip(values["text_a"], values["text_b"]):
            if text_a == 1 and text_b == 1:
                both += 1
                annotators[annotator_id]["stats"].append(3)
            elif text_a == 1:
                premise_only += 1
                annotators[annotator_id]["stats"].append(1)
            elif text_b == 1:
                hypothesis_only += 1
                annotators[annotator_id]["stats"].append(2)
            else:
                none += 1
                annotators[annotator_id]["stats"].append(0)
        print("Annotator {}: premise_only = {}, hypothesis_only = {}, both = {}, none = {}".format(annotator_id, premise_only, hypothesis_only, both, none))

    ann_agreement_levels = {1: {1: 0, 2: 0, 3: 0, 0: 0},
                            2: {1: 0, 2: 0, 3: 0, 0: 0},
                            3: {1: 0, 2: 0, 3: 0, 0: 0},}

    selected_indices = []
    for idx, (a1, a2, a3) in enumerate(zip(annotators[1]["stats"], annotators[2]["stats"], annotators[3]["stats"])):
        if a1 == a2 == a3:
            ann_agreement_levels[3][a1] += 1
            if a1 == 3:
                selected_indices.append(idx)
        elif a1 == a2 or a1 == a3:
            ann_agreement_levels[2][a1] += 1
        elif a2 == a3:
            ann_agreement_levels[2][a2] += 1

    for key, values in ann_agreement_levels.items():
        print("Agreement level {}: premise_only = {}, hypothesis_only = {}, both = {}, none = {}".format(
            ">={}".format(key), values[1], values[2], values[3], values[0]))

    print("Selected indices: {}".format(selected_indices))
    # ------------------------------------------------------------------------------------------------------------

    pickle_fp = "../../../data/pickle_files/human_annotations/"
    if not exists(pickle_fp):
        makedirs(pickle_fp)

    with open(pickle_fp + "esnli_preprocessed.pickle", "wb") as file_path:
        pickle.dump(examples, file_path)

    print("Complete! There are {} examples.".format(len(examples)))


def get_highlight_text(tokens, gt_set):

    # token's foreground is black, token's background is orange/yellow
    format = ';'.join([str(0), str(30), str(43)])

    highlight_tokens_set = copy.deepcopy(tokens)

    for idx, token in enumerate(tokens):
        highlight_tokens_set[idx] = '\x1b[%sm%s\x1b[0m' % (format, token) if idx in gt_set else token

    return " ".join(highlight_tokens_set)


